import React from 'react';
import ButtonCounter from './components/counter/button';
import ResultCounter from './components/counter/result';
export default class counter extends React.Component {
	render() {
		return (
			<>
				<ResultCounter count={0} />
				<ButtonCounter type="button" name="increment">
					+
				</ButtonCounter>
				<ButtonCounter type="button" name="decrement">
					-
				</ButtonCounter>
			</>
		);
	}
}
